import React from "react";

import { NavLink } from "react-router-dom";

import { reveal as Menu } from "react-burger-menu";

import { Drawer } from "antd";
import { SimpleButton, MapComponent } from "@terrestris/react-geo";

import "bootstrap/dist/css/bootstrap.min.css";
import { Card, Accordion, Button } from "react-bootstrap";

class Navigation extends Component {
  state = { visible: false };

  toggleDrawer = () => {
    this.setState({ visible: !this.state.visible });
  };

  render() {
    return (
      <Drawer
        title='Menüleiste'
        placement='left'
        onClose={this.toggleDrawer}
        visible={this.state.visible}
        mask={false}
        width='60vh'
      >
        <input
          type='text'
          placeholder='Straßen- oder Gebäudename...'
          id='inputSearch'
        ></input>
        <input type='submit' value='Suchen' id='form-btn'></input>

        <img
          src='https://kommunikation-marketing.uni-koeln.de/e135228/e136450/e136573/e136614/e136634/013_Unisiegel_plus_Schriftzug_DE_ger.jpg'
          id='logoSchriftzug'
        ></img>
      </Drawer>
    );
  }
}

export default Navigation;
